import React from "react";
import "./Jumbotron.css"

const Jumbotron = () => (
    <div className="jumbotron ">
        <p id="title">Google Books Search</p>
        <p id="sub-title"> Search for and Save Books of Interest</p>

    </div>
);

export default Jumbotron;
